    //         await axios.delete(`http://localhost:8082/team/${props.id}`);
    //     } catch(error) {
    //         console.log(error)
    //     }
    // }
    const handleDelete = () => {
        console.log('delete route hit', props)
        axios
            .delete(`http://localhost:8082/team/` + props.id)
            // .then(props.history.push("/team"))
            .catch(err => console.log('error', err))
    }

    return (
        <Button onClick={handleDelete}>Delete</Button>
    )
}

export default DeleteButton;
